import React from 'react'
import RegisterImage from '../../assets/images/register.webp';
const AuthImage = () => {
  return (
    <div>
        <img src={RegisterImage} alt='Register image' loading='lazy' className='w-full h-full object-cover' />
    </div>
  )
}

export default AuthImage
